import React from 'react'
import style from './index.module.scss'
export default function index() {
  const goto_jieji = () => {
    console.log("gg");
  }
  const goto_songji = () => {
    console.log("ff");
  }
  return (
    <div className={style.box_1}>
      <div className={style.nav}>
        <div onClick={goto_jieji} className={(style.function, style.jieji)}>
          <img src="assets/icon/jieji/plane_2.png"></img>
          <div>Pick-up</div>
        </div>
        <div onClick={goto_songji} className={(style.function, style.songji)}>
          <img src="assets/icon/jieji/plane_1.png"></img>
          <div>Drop-off</div>
        </div>
        <div className={(style.function, style.dache)}>
          <img src="assets/icon/jieji/car_1.png"></img>
          <div>Chartered</div>
        </div>
        <div className={(style.function, style.songhuo)}>
          <img src="assets/icon/jieji/car_2.png"></img>
          <div>Delivery</div>
        </div>
      </div>
    </div>



  )
}
